import { apiClient } from "./ApiClient";

export const getUserIn4Api 
    = () => apiClient.get(`/user`);

export const changePasswordApi
    = (oldPassword, newPassword) => apiClient.post(`/user/change-password`, {oldPassword, newPassword});
